const forms = [
  { id: 'brgy-clearance', title: 'Barangay Clearance', description: 'For various local transactions.', path: '/forms/Barangay_Clearance.pdf' },
  { id: 'bplo-application', title: 'Business Permit Application', description: 'New or renewal of business permits.', path: '/forms/Business_Permit_Application.pdf' },
  { id: 'birth-cert', title: 'Birth Certificate Request', description: 'Civil registry request form.', path: '/forms/Birth_Certificate_Request.pdf' },
  { id: 'cedula', title: 'Community Tax Certificate (Cedula)', description: 'Cedula application form.', path: '/forms/Cedula_Application.pdf' },
  { id: 'building-permit', title: 'Building Permit Application', description: 'Permit for building construction.', path: '/forms/Building_Permit_Application.pdf' }
];

export default forms;
